import React, { Component } from 'react';
import "../components/LIST/List.css";

class Comp extends Component {

    deleteitem=()=> {
        this.props.onClick(this.props.id);
      }
    render() { 
        return ( 
            <div className='List' onClick={this.deleteitem} >{this.props.val}</div>
         );
    }
}

export default Comp;
